import './Account.css';
import jwt from 'jwt-decode';

export default function Account() {
  let a;
  try {
    a = jwt(token);
  } catch (error) {
    localStorage.removeItem('ticket');
    return (
      <div className="App">
        <header className="App-title">My Account</header>
        <div className="outer">
          <div className="inner rounded">
            <h2>There is no data. Please login again</h2>
          </div>
        </div>
      </div>
    );
  }

  return (
    <div className="App">
      <header className="App-title">My Account</header>
      <div className="outer">
        <div className="inner rounded">
          <h3>{a.name}</h3>
          <h6>{a.team}</h6>
          <h6>WWID: {a.ssid}</h6>
          <h6>Mail: {a.mail}</h6>
          <br></br>

        </div>
      </div>
    </div>
  );

}
